(2, 2, '{\"brand_name\":\"iXtif\",\"city\":\"\\u0130stanbul\",\"business_start_year\":\"2015\",\"main_service\":\"End\\u00fcstriyel istif ve depo ekipmanlar\\u0131 (forklift, transpalet, istif makinesi, reach truck) sat\\u0131\\u015f\\u0131, kiralama, teknik servis ve yedek par\\u00e7a hizmetleri. Geni\\u015f \\u00fcr\\u00fcn yelpazesi ve kaliteli hizmet anlay\\u0131\\u015f\\u0131yla m\\u00fc\\u015fterilerimize \\u00e7\\u00f6z\\u00fcmler sunuyoruz.\",\"experience_years\":\"10 y\\u0131l\",\"contact_info\":\"Telefon: 0216 755 3 555, Mobil: 0501 005 67 58, WhatsApp: 0501 005 67 58, E-posta: info@ixtif.com, Adres: Tuzla Ana Depo, \\u0130stanbul - Anadolu Yakas\\u0131\",\"share_founder_info\":\"Evet, bilgilerimi payla\\u015fmak istiyorum\"}', '{\"sector_selection\":\"forklift_sales\",\"forklift_main_services\":{\"Yeni ekipman sat\\u0131\\u015f\\u0131\":true,\"\\u0130kinci el ekipman sat\\u0131\\u015f\\u0131\":true,\"Ekipman kiralama\":true,\"Teknik servis ve bak\\u0131m\":true,\"Yedek par\\u00e7a sat\\u0131\\u015f\\u0131\":true,\"Periyodik bak\\u0131m s\\u00f6zle\\u015fmeleri\":true,\"Operat\\u00f6r e\\u011fitimi\":true,\"Saha dan\\u0131\\u015fmanl\\u0131\\u011f\\u0131\":true},\"equipment_types\":{\"Forklift (Dizel\\/LPG\\/Elektrikli)\":true,\"Ak\\u00fcl\\u00fc transpalet\":true,\"Manuel transpalet\":true,\"\\u0130stif makinesi (Stacker)\":true,\"Reach truck (Y\\u00fcksek istif)\":true,\"Order picker (Sipari\\u015f toplama)\":true,\"Di\\u011fer lojistik ekipmanlar\\u0131\":true},\"equipment_capacity\":{\"1-2 ton (Hafif ekipmanlar)\":true,\"2-3 ton (Orta s\\u0131n\\u0131f)\":true,\"3-5 ton (A\\u011f\\u0131r s\\u0131n\\u0131f)\":true,\"5-10 ton (\\u00c7ok a\\u011f\\u0131r)\":true},\"target_industries\":{\"Lojistik ve depolama\":true,\"\\u00dcretim tesisleri\":true,\"\\u0130n\\u015faat\":true,\"Perakende ve marketler\":true,\"Liman ve havaliman\\u0131\":true,\"Otomotiv sekt\\u00f6r\\u00fc\":true,\"G\\u0131da ve i\\u00e7ecek\":true,\"Tekstil\":true,\"Mobilya \\u00fcretimi\":true,\"Genel ticaret\":true},\"equipment_brands\":\"\\u00c7e\\u015fitli yerli ve ithal markalar\\u0131n geni\\u015f \\u00fcr\\u00fcn yelpazesi. Li-Ion batarya teknolojisiyle elektrikli forklift, transpalet, istif makinesi ve reach truck modelleri sunuyoruz.\",\"service_coverage\":\"T\\u00fcrkiye geneli\",\"warranty_support\":{\"\\u00dcretici garantisi\":true,\"Ek garanti paketleri\":true,\"7\\/24 teknik destek\":true,\"Yerinde m\\u00fcdahale hizmeti\":true,\"Yedek ekipman sa\\u011flama\":true,\"Periyodik bak\\u0131m kontrolleri\":true,\"Par\\u00e7a temin garantisi\":true},\"payment_financing\":{\"Pe\\u015fin sat\\u0131\\u015f\":true,\"Taksitli \\u00f6deme\":true,\"Leasing (finansal kiralama)\":true,\"Operasyonel kiralama\":true,\"\\u0130kinci el takas imkan\\u0131\":true}}', '[]', '{\"brand_character\":\"Profesyonel, g\\u00fcvenilir, \\u00e7\\u00f6z\\u00fcm odakl\\u0131, teknik uzmanl\\u0131\\u011fa sahip, geli\\u015fmeye a\\u00e7\\u0131k, eri\\u015filebilir. Hem kurumsal B2B m\\u00fc\\u015fterilere hem KOB\\u0130\'lere kaliteli hizmet sunan, \\u015feffaf ve d\\u00fcr\\u00fcst ileti\\u015fim kuran bir markay\\u0131z.\",\"writing_style\":\"Teknik detaylar\\u0131 sade ve anla\\u015f\\u0131l\\u0131r dilde anlatan, jargondan ka\\u00e7\\u0131nan, dan\\u0131\\u015fmanl\\u0131k odakl\\u0131, e\\u011fitici ve y\\u00f6nlendirici. M\\u00fc\\u015fteriye \\\"do\\u011fru sorular\\u0131\\\" sorarak ihtiyac\\u0131n\\u0131 net bir \\u015fekilde belirlemeye \\u00e7al\\u0131\\u015fan, alternatif \\u00e7\\u00f6z\\u00fcmler sunan bir \\u00fcslup.\",\"ai_response_style\":\"H\\u0131zl\\u0131 ve net bilgi veren, teknik soru sorabilecek kadar uzman, ama karma\\u015f\\u0131k terimlerle bo\\u011fmayan. M\\u00fc\\u015fterinin seviyesine uygun dil kullanarak kiralama, sat\\u0131n alma, servis gibi konularda rehberlik eden. Alternatif sunarak m\\u00fc\\u015fteriyi do\\u011fru karara y\\u00f6nlendiren.\",\"sales_approach\":\"Dan\\u0131\\u015fmanl\\u0131k odakl\\u0131 sat\\u0131\\u015f. \\u00d6nce m\\u00fc\\u015fterinin ihtiyac\\u0131n\\u0131 anla (ne ta\\u015f\\u0131yacak, ne kadar y\\u00fck, ne s\\u0131kl\\u0131kla, kapal\\u0131\\/a\\u00e7\\u0131k alan, b\\u00fct\\u00e7e), sonra en uygun ekipman\\u0131 \\u00f6ner. Sat\\u0131n alma, kiralama, ikinci el gibi se\\u00e7enekleri objektif kar\\u015f\\u0131la\\u015ft\\u0131r. Uzun vadeli m\\u00fc\\u015fteri ili\\u015fkisi kur, sat\\u0131\\u015f sonras\\u0131 destek vurgula.\",\"response_style\":{\"K\\u0131sa ve \\u00f6z yan\\u0131tlar\":true,\"Detayl\\u0131 a\\u00e7\\u0131klamalar (Teknik konularda)\":true,\"Say\\u0131sal veriler sunma (Kapasite, fiyat, garanti s\\u00fcresi vb.)\":true,\"Alternatif \\u00e7\\u00f6z\\u00fcmler \\u00f6nerme\":true,\"Empatik ileti\\u015fim\":true},\"forbidden_topics\":\"Rakip markalar\\u0131 k\\u00f6t\\u00fcleme, ger\\u00e7ek\\u00e7i olmayan vaatler (\\u00f6rn. \\\"T\\u00fcrkiye\'nin en iyisi\\\", \\\"hi\\u00e7 ar\\u0131za yapmaz\\\"), m\\u00fc\\u015fteri bilgilerini payla\\u015fma, fiyat pazarl\\u0131\\u011f\\u0131nda agresif tutum. M\\u00fc\\u015fteriye \\\"yanl\\u0131\\u015f se\\u00e7im yapt\\u0131n\\u0131z\\\" demek yerine \\\"ihtiyac\\u0131n\\u0131za daha uygun alternatif\\\" sun. Kendimizi sekt\\u00f6r\\u00fcn lideri olarak tan\\u0131tma, m\\u00fctevaz\\u0131 ve ger\\u00e7ek\\u00e7i kal.\",\"writing_tone\":\"Profesyonel ama samimi, resmi ama eri\\u015filebilir. Kurumsal m\\u00fc\\u015fterilere daha teknik ve ciddi, KOB\\u0130\'lere daha a\\u00e7\\u0131klay\\u0131c\\u0131 ve destekleyici. Her zaman sayg\\u0131l\\u0131, yard\\u0131msever ve \\u00e7\\u00f6z\\u00fcm odakl\\u0131. M\\u00fctevaz\\u0131 ve ger\\u00e7ek\\u00e7i bir dil kullan.\",\"content_approach\":\"E\\u011fitici i\\u00e7erikler (forklift se\\u00e7im rehberi, bak\\u0131m ipu\\u00e7lar\\u0131, g\\u00fcvenlik kurallar\\u0131), sekt\\u00f6rel \\u00e7\\u00f6z\\u00fcmler, \\u00fcr\\u00fcn kar\\u015f\\u0131la\\u015ft\\u0131rmalar\\u0131. M\\u00fc\\u015fteriyi bilin\\u00e7lendiren, karar s\\u00fcrecini kolayla\\u015ft\\u0131ran i\\u00e7erikler. Abart\\u0131s\\u0131z, ger\\u00e7ek\\u00e7i bilgiler sun.\",\"emphasis_points\":\"10 y\\u0131l sekt\\u00f6r deneyimi, Geni\\u015f istif ekipman\\u0131 \\u00fcr\\u00fcn yelpazesi, 7\\/24 teknik destek ve saha servisi, Esnek kiralama se\\u00e7enekleri (g\\u00fcnl\\u00fck, ayl\\u0131k, y\\u0131ll\\u0131k), S\\u0131f\\u0131r, ikinci el ve kiral\\u0131k ekipman alternatifleri, Operat\\u00f6r e\\u011fitimi ve sertifika programlar\\u0131, Orijinal yedek par\\u00e7a tedariki, Tuzla Ana Depo - stok alan\\u0131, Kurumsal B2B ve KOB\\u0130\'lere \\u00f6zel \\u00e7\\u00f6z\\u00fcmler, Takas imkan\\u0131 ve esnek \\u00f6deme se\\u00e7enekleri, Kaliteli hizmet anlay\\u0131\\u015f\\u0131 ve g\\u00fcvenilirlik\",\"avoid_topics\":\"Politik konular, rakip firma fiyat kar\\u015f\\u0131la\\u015ft\\u0131rmalar\\u0131, kesin garanti verme (\\u00f6rn. \\\"kesinlikle %30 tasarruf\\\"), m\\u00fc\\u015fteri finansal durumu hakk\\u0131nda varsay\\u0131m yapma, bask\\u0131c\\u0131 sat\\u0131\\u015f taktikleri. \\\"Lider\\\", \\\"en iyi\\\", \\\"en geni\\u015f\\\" gibi abart\\u0131l\\u0131 ifadelerden ka\\u00e7\\u0131n. Kendimizi b\\u00fcy\\u00fck g\\u00f6sterme, hedeflerimizi payla\\u015f ama ger\\u00e7ek\\u00e7i kal.\"}', '{\"founder_name\":\"Nurullah Okatan\",\"founder_role\":\"Kurucu & CEO\",\"founder_additional_info\":\"Nurullah Okatan, T\\u00fcrk Bili\\u015fim \\u015eirketinin kurucusu ve bilgisayar yaz\\u0131l\\u0131m uzman\\u0131d\\u0131r. Ticaret konusunda da ba\\u015far\\u0131l\\u0131 olan Okatan, bir\\u00e7ok alanda yetkinli\\u011fe sahiptir. T\\u00fcrkiye\'nin lider firmalar\\u0131na, \\u00fcniversite, hastane, holding gibi b\\u00fcy\\u00fck kurumsal firmalara uzun y\\u0131llard\\u0131r dan\\u0131\\u015fmanl\\u0131k yapmakta ve hala da yapmaktad\\u0131r. \\u0130stif ve depo ekipmanlar\\u0131 sekt\\u00f6r\\u00fcndeki vizyoner yakla\\u015f\\u0131m\\u0131yla iXtif\'i b\\u00fcy\\u00fctmeye devam etmektedir.\",\"founder_story\":\"Nurullah Okatan, bili\\u015fim sekt\\u00f6r\\u00fcndeki uzmanl\\u0131\\u011f\\u0131n\\u0131 ticaret alan\\u0131na ta\\u015f\\u0131yarak iXtif\'i kurdu. Yaz\\u0131l\\u0131m ve teknoloji ge\\u00e7mi\\u015fi sayesinde istif ekipmanlar\\u0131 sekt\\u00f6r\\u00fcne modern ve dijital bir bak\\u0131\\u015f a\\u00e7\\u0131s\\u0131 getirdi. Kurumsal dan\\u0131\\u015fmanl\\u0131k deneyimi, iXtif\'in B2B m\\u00fc\\u015fterilere \\u00f6zel \\u00e7\\u00f6z\\u00fcmler sunmas\\u0131nda \\u00f6nemli rol oynad\\u0131. \\\"Teknoloji ve ticaretin kesi\\u015fti\\u011fi noktada, m\\u00fc\\u015fterilerimize kaliteli hizmet sunmak\\\" vizyonuyla hareket eden Okatan, iXtif\'i 10 y\\u0131lda istif pazar\\u0131nda g\\u00fcvenilir bir marka konumuna ta\\u015f\\u0131d\\u0131.\",\"biggest_challenge\":\"\\u0130stif ekipmanlar\\u0131 sekt\\u00f6r\\u00fcnde g\\u00fcven ve teknik uzmanl\\u0131k olu\\u015fturmak en b\\u00fcy\\u00fck zorluklar\\u0131m\\u0131zdand\\u0131. M\\u00fc\\u015fterilerin \\\"ucuz \\u00fcr\\u00fcn\\\" yerine \\\"do\\u011fru \\u00fcr\\u00fcn\\\" se\\u00e7mesini sa\\u011flamak, uzun vadeli bak\\u0131m ve servis k\\u00fclt\\u00fcr\\u00fc olu\\u015fturmak, teknoloji ile geleneksel ticaretin dengesini kurmak gibi konularda \\u00e7aba g\\u00f6steriyoruz. Bug\\u00fcn, kurumsal firmalardan KOB\\u0130\'lere kadar \\u00e7e\\u015fitli m\\u00fc\\u015fteri portf\\u00f6y\\u00fcne sahip olmam\\u0131z\\u0131n temelinde, kaliteden \\u00f6d\\u00fcn vermeme ve m\\u00fc\\u015fteri memnuniyetini \\u00f6nceliklendirme ilkelerimiz yat\\u0131yor.\"}', '[]', NULL, NULL, NULL, NULL, NULL, NULL, 0.00, 'F', 'normal', NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 0.00, 1, NULL, 1, 1, 0, NULL, '2025-10-21 21:52:01', '2025-10-29 02:24:53');

